import React, { Fragment } from "react";
import { useParams } from "react-router-dom";
import { data } from "../data/data";
import "react-bubble-ui/dist/index.css";

export const NewPage = () => {
  const { id } = useParams();
  return (
    <Fragment>
    <div>
    {data.map((item) => item.id == id && <p className="card__description" key={id}>{item.description}</p>)}
    </div>
    <table className="card">
      <tr>
        <th>Id</th>
        <th>Title</th>
        <th>Website</th>
      </tr>
      {data.map((item) => item.id == id && item.datas.map((a) => <tr className="card__item" key={a.id}>
          <td><p>{a.id}</p></td>
          <h4>{a.title}</h4>
          <a className="card__link" href={`${a.link}`}>Link to website</a>
        </tr>))}
    </table>
    </Fragment>
  );
};
